Note: This script will search for all Jupyter notebooks with the ".ipynb" extension in all directories and subdirectories starting from the home directory. The resulting paths will be stored in the list "notebook_paths".

Here's a Python script that takes a list of notebooks and reads the code cells into a string:

```python
import nbformat

def read_notebooks(notebooks):
    code_cells = []
    for notebook in notebooks:
        with open(notebook, 'r') as f:
            nb = nbformat.read(f, as_version=4)
            for cell in nb.cells:
                if cell.cell_type == 'code':
                    code_cells.append(cell.source)
    return ''.join(code_cells)
```

You can call this function with a list of notebook file paths as an argument, and it will return a string containing the code cells from all the notebooks concatenated together.

