def find_my_strings(string):
    my_strings = []
    index = 0
    while index < len(string):
        if string[index:index+3] == 'my.':
            end_index = string.find(')', index)
            if end_index != -1:
                my_strings.append(string[index:end_index+1])
            index = end_index
        index += 1
    return my_strings

